import { Link } from "react-router-dom";
import { useNavigate } from "react-router-dom";

const NormalHeader = () => {
  let navigate = useNavigate();

  const navigateToForgetPasswordPage = () => {
    navigate("/customer/forgetPassword");
  };

  return (
    <div>
      <ul className="navbar-nav ms-auto mb-2 mb-lg-0 me-5 justify-content-end">
        <li className="nav-item">
          <Link
            to="/user/customer/register"
            className="nav-link active interactive-link"
            aria-current="page"
          >
            <b className="text-color">Register</b>
          </Link>
        </li>

        <li className="nav-item">
          <Link
            to="/user/login"
            className="nav-link active interactive-link"
            aria-current="page"
          >
            <b className="text-color">Login</b>
          </Link>
        </li>

        <li className="nav-item">
          <Link
            to=""
            className="nav-link active interactive-link"
            aria-current="page"
          >
            <b className="text-color">About Us</b>
          </Link>
        </li>
      </ul>

      {/* Add CSS for interactive buttons */}
      <style jsx>{`
        /* Navbar styling */
        .navbar-nav {
          display: flex;
          gap: 20px;
        }

        .nav-link {
          font-size: 1.1rem;
          font-weight: 500;
          color: #fff;
          transition: all 0.3s ease;
          text-align: center;
        }

        /* Button-like styles */
        .interactive-link {
          padding: 10px 25px;
          background-color: transparent;
          border: 2px solid transparent;
          border-radius: 5px;
          text-transform: uppercase;
          display: inline-block;
          cursor: pointer;
          transition: all 0.3s ease;
        }

        /* Hover effect for links turning them into buttons */
        .interactive-link:hover {
          background-color: #f8b400;
          color: #222222;
          border-color: #f8b400;
        }

        /* Active link styles */
        .nav-link.active {
          color: #f8b400;
        }

        /* Hover effect for text color */
        .text-color {
          color: #fff;
          transition: all 0.3s ease;
        }

        /* Hover effect for text-color */
        .text-color:hover {
          color: #f8b400;
        }

        /* Right alignment for navbar items */
        .navbar-nav.justify-content-end {
          margin-left: auto;
        }

        /* Spacing between items */
        .nav-item {
          padding: 0 10px;
        }

        /* Optional: Make the navbar responsive for smaller screens */
        @media (max-width: 768px) {
          .navbar-nav {
            flex-direction: column;
            align-items: center;
          }

          .nav-item {
            margin-bottom: 10px;
          }
        }
      `}</style>
    </div>
  );
};

export default NormalHeader;
